              }
            }
          },
          "x-originalParamName": "Body"
        },
        "responses": {
          "302": {
            "$ref": "#/components/responses/emptyResponse"
          },
          "400": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/verificationFlow"
                }
              }
            },
